import "./navbar.css";

export default function Navbar() {
  return (
    <>
    <div className="footer">
        <img src="https://cdn-icons-png.flaticon.com/128/4047/4047371.png" alt="photo" />
        <span className="text">PhotoFolio</span>
    </div>
    </>
  )
}
